contract Ex2_8 {

    bool a = 3 > 4; // false
    bool b = 3 < 4; // true
    bool c = 5 >= 2; // true
    bool d = 5 <= 2; // false
    bool e = 3 == 2; // false
    bool f = 3 != 2; // true

    function comparison() public view returns (bool, bool, bool, bool, bool, bool){
        return (a,b,c,d,e,f);
    }
}

